function CreateCourse(){const e=$("#CourseFrom").serialize();$.ajax({url:"/api/admin/CourseEdit/CreateCourse",type:"PUT",data:e,success:function(e){prepareToast("CheckCircle.svg","Success","Course created successfully <p>You will be moved shortly</p>"),setTimeout(()=>{window.location.href="/Admin/Course/"+e},2e3)},error:function(e){prepareToast("xmark.svg","Error",e.responseJSON.errorMessage)}})}onsubmit=(e=>{e.preventDefault(),CreateCourse()});